import React from "react";
import ReactDOM from "react-dom";
//import add from "./Calc";
import { add ,mult , div }  from "./Calc";


ReactDOM.render(
    <>
    <ol>
    <h1><li>hey this is your output</li></h1>
    <li>{add(3,4)}</li>
    <li>{mult(8,7)}</li> 
    <li>{div(9,3)}</li>
     
     </ol>
     


    </>,
    document.getElementById("root"));
